import React from 'react'
import dh_logo from '../images/DH.png';
import dentistImage from '../images/doctor.jpg';
import facebook from '../images/ico-facebook.png';
import tiktok from '../images/ico-tiktok.png';
import whatsapp from '../images/doctor.jpg';
import Instagram from '../images/doctor.jpg';


const Footer = () => {
  return (
    <footer>
        <p>Powered by</p>
        <img src={dh_logo} alt='DH-logo' />
    </footer>
  )
}

export default Footer
